import React from "react";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";import Contact from './contact';
import Home from './home'
import Navbar from './navbar'

function App() {

  return (
    <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/contact' exact element={Contact} />
        </Routes>
   </BrowserRouter>
  );
};

export default App;
